<body>
<div class="container" style="max-width: none">
<h1>ClickHouse Keyword Reference</h1>
<nav>[ <a href="index.html">Function Reference</a> | <a href="keywords.html">Keyword Reference</a> ]</nav>
<div class="main">

    <input type="text" id="search" onkeyup="search()" placeholder="Search for keywords...">
    
    <script>
    function search() {
        const input = document.getElementById('search').value.toUpperCase();
        const table = document.getElementById('feature_table');
        const rows = table.getElementsByTagName('tr');
        for (let i = 1; i < rows.length; i++) {
            const cells = rows[i].getElementsByTagName('td');
            let found = false;
            for (const cell of cells) {
                if (cell.textContent.toUpperCase().includes(input)) {
                    found = true;
                    break;
                }
            }
            if (found) {
                rows[i].style.display = '';
            } else {
                rows[i].style.display = 'none';
            }
        }
    }
    </script>
    <table id='feature_table'></table><script>
    const table = document.getElementById('feature_table');
    const features = Object.keys(availability);
    const versions = [...new Set(Object.values(availability).flat())];
    const header = table.createTHead();
    const headerRow = header.insertRow(0);
    headerRow.insertCell(0);

    for (const version of versions) {
        const cell = headerRow.insertCell();
        cell.textContent = version;
    }

    for (const feature of features) {
        const row = table.insertRow();
        const cell = row.insertCell();
        cell.textContent = feature;
        for (const version of versions) {
            const cell = row.insertCell();
            if (availability[feature].includes(version)) {
                cell.textContent = '✓';
                cell.style.backgroundColor = 'green';
            } else {
                cell.textContent = '✗';
                cell.style.backgroundColor = 'red';
            }
            cell.onmouseover = () => showTooltip(cell, version, feature);
            cell.onmouseout = () => hideTooltip(cell);
        }
    }

    function showTooltip(cell, version, feature) {
        const tooltip = document.createElement('div');
        tooltip.style.position = 'absolute';
        tooltip.style.backgroundColor = 'black';
        tooltip.style.color = 'white';
        tooltip.style.padding = '10px';
        tooltip.style.borderRadius = '5px';
        tooltip.style.zIndex = '1000';
        
        if (availability[feature].includes(version)) {
            tooltip.textContent = `${feature} is available in ${version}`;
        } else {
            tooltip.textContent = `${feature} is not available in ${version}`;
        }
        
        cell.appendChild(tooltip);
    }

    function hideTooltip(cell) {
        cell.removeChild(cell.lastChild);
    }

    </script></div></div><div style='margin-top: 5px'><footer><p>Source on <a href='https://github.com/JosephRedfern/clickhouse-function-reference'>GitHub</a></p></footer></div><script src="https://cdn.jsdelivr.net/npm/bootstrap@5.3.3/dist/js/bootstrap.bundle.min.js" integrity="sha384-YvpcrYf0tY3lHB60NNkmXc5s9fDVZLESaAA55NDzOxhy9GkcIdslK1eN7N6jIeHz" crossorigin="anonymous"></script></body>
